import React from 'react';
import './App.css';
import {getPlayerIconPNGLink} from './LeagueOfLegendsApi.js';

/**
 * League player profile for Myslibros
 */
function LeagueProfile(props) {

    const playerIconSrc = getPlayerIconPNGLink(props.leagueName);


    return (
        <div className="league-profile">
            <div className="league-name">
                <img src={playerIconSrc}></img>
                <h1>{props.leagueName}</h1>
            </div>
            <div className="league-info">

            </div>
        </div>
    );
}

export default LeagueProfile;
